  import React from 'react';
  import { mdx } from '@mdx-js/react';

  export const frontMatter = {
	id: 'data_writers',
	title: 'Writing Data to Files'
};
export const metadata = {
  "unversionedId": "fundamentals/data_writers",
  "id": "fundamentals/data_writers",
  "isDocsHomePage": false,
  "title": "Writing Data to Files",
  "description": "VideoWriter \\sink",
  "source": "@site/docs/fundamentals/data_writers.md",
  "slug": "/fundamentals/data_writers",
  "permalink": "/docs/fundamentals/data_writers",
  "editUrl": "https://github.com/spewil/bonsai-rx-docs/edit/master/website/docs/fundamentals/data_writers.md",
  "version": "current"
};
  /* @jsxRuntime classic */
/* @jsx mdx */

export const rightToc = [{
  value: '<strong><code>VideoWriter</code></strong> #sink',
  id: 'videowriter-sink',
  children: []
}, {
  value: '<strong><code>CsvWriter</code></strong> #sink',
  id: 'csvwriter-sink',
  children: []
}, {
  value: '<strong><code>MatrixWriter</code></strong> #sink',
  id: 'matrixwriter-sink',
  children: []
}, {
  value: 'Common errors',
  id: 'common-errors',
  children: []
}];

const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h3 {...{
      "id": "videowriter-sink"
    }}><strong parentName="h3"><inlineCode parentName="strong">{`VideoWriter`}</inlineCode></strong>{` `}{`#`}{`sink`}</h3>
    <p>{`writes the input image sequence to a compressed `}<inlineCode parentName="p">{`.avi`}</inlineCode>{` file`}</p>
    <p><strong parentName="p">{`input`}</strong>{` (`}<em parentName="p">{`OpenCV.Net.IpIImage`}</em>{`) - 2D matrix of pixels, such as that produced by `}<inlineCode parentName="p">{`CameraCapture`}</inlineCode>{` or the `}<inlineCode parentName="p">{`Image`}</inlineCode>{` output of other camera source nodes`}</p>
    <p><strong parentName="p">{`properties`}</strong>{`:`}</p>
    <ul>
      <li parentName="ul"><inlineCode parentName="li">{`Buffered`}</inlineCode>{` (`}<em parentName="li">{`bool`}</em>{`) - indicates whether writing should be buffered`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`FileName`}</inlineCode>{` (`}<em parentName="li">{`string`}</em>{`) - name of the output file or full path to the
output file if the desired path is different from the current
working directory`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`FourCC`}</inlineCode>{` (`}<em parentName="li">{`string`}</em>{`) - the four-character code of the codec used to
compress video frames, e.g. `}<inlineCode parentName="li">{`FMP4`}</inlineCode></li>
      <li parentName="ul"><inlineCode parentName="li">{`FrameRate`}</inlineCode>{` (`}<em parentName="li">{`double`}</em>{`) - playback frame rate of the image sequence`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`FrameSize`}</inlineCode>{` (`}<em parentName="li">{`OpenCV.Net.Size`}</em>{`) - frame size in the output file`}
        <ul parentName="li">
          <li parentName="ul"><inlineCode parentName="li">{`Width`}</inlineCode>{` (`}<em parentName="li">{`int`}</em>{`)`}</li>
          <li parentName="ul"><inlineCode parentName="li">{`Height`}</inlineCode>{` (`}<em parentName="li">{`int`}</em>{`)`}</li>
        </ul>
      </li>
      <li parentName="ul"><inlineCode parentName="li">{`Overwrite`}</inlineCode>{` (`}<em parentName="li">{`bool`}</em>{`) - indicates whether the output file should be
overwritten if it already exists`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`ResizeInterpolation`}</inlineCode>{` (`}<em parentName="li">{`OpenCV.Net.SubPixelInterpolation`}</em>{`) -
interpolation method used to resize video frames, e.g.
`}<inlineCode parentName="li">{`NearestNeighbor`}</inlineCode></li>
      <li parentName="ul"><inlineCode parentName="li">{`Suffix`}</inlineCode>{` (`}<em parentName="li">{`Bonsai.IO.PathSuffix`}</em>{`) - optional suffix used to generate
file names: `}<inlineCode parentName="li">{`None`}</inlineCode>{`, `}<inlineCode parentName="li">{`FileCount`}</inlineCode>{`, `}<inlineCode parentName="li">{`Timestamp`}</inlineCode>{`; generates new files
even if `}<inlineCode parentName="li">{`Overwrite`}</inlineCode>{` is set to True`}</li>
    </ul>
    <p><strong parentName="p">{`output`}</strong>{` (`}<em parentName="p">{`OpenCV.Net.IpIImage`}</em>{`):`}</p>
    <ul>
      <li parentName="ul"><inlineCode parentName="li">{`IsInvalid`}</inlineCode>{` (`}<em parentName="li">{`bool`}</em>{`)`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`ElementType`}</inlineCode>{` (`}<em parentName="li">{`int`}</em>{`)`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`Size`}</inlineCode>{` (`}<em parentName="li">{`OpenCV.Net.Size`}</em>{`)`}
        <ul parentName="li">
          <li parentName="ul"><inlineCode parentName="li">{`Width`}</inlineCode>{` (`}<em parentName="li">{`int`}</em>{`)`}</li>
          <li parentName="ul"><inlineCode parentName="li">{`Height`}</inlineCode>{` (`}<em parentName="li">{`int`}</em>{`)`}</li>
        </ul>
      </li>
      <li parentName="ul"><inlineCode parentName="li">{`Depth`}</inlineCode>{` (`}<em parentName="li">{`OpenCV.Net`}</em>{`.`}<em parentName="li">{`IpIDepth`}</em>{`)`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`Channels`}</inlineCode>{` (`}<em parentName="li">{`int`}</em>{`)`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`Width`}</inlineCode>{` (`}<em parentName="li">{`int`}</em>{`)`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`Height`}</inlineCode>{` (`}<em parentName="li">{`int`}</em>{`)`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`WidthStep`}</inlineCode>{` (`}<em parentName="li">{`int`}</em>{`)`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`ImageData`}</inlineCode>{` (`}<em parentName="li">{`System.IntPtr`}</em>{`)`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`ChannelOfInterest`}</inlineCode>{` (`}<em parentName="li">{`int`}</em>{`)`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`RegionOfInterest`}</inlineCode>{` (`}<em parentName="li">{`OpenCV.Net.Rect`}</em>{`)`}
        <ul parentName="li">
          <li parentName="ul"><inlineCode parentName="li">{`X`}</inlineCode>{` (`}<em parentName="li">{`int`}</em>{`)`}</li>
          <li parentName="ul"><inlineCode parentName="li">{`Y`}</inlineCode>{` (`}<em parentName="li">{`int`}</em>{`)`}</li>
          <li parentName="ul"><inlineCode parentName="li">{`Width`}</inlineCode>{` (`}<em parentName="li">{`int`}</em>{`)`}</li>
          <li parentName="ul"><inlineCode parentName="li">{`Height`}</inlineCode>{` (`}<em parentName="li">{`int`}</em>{`)`}</li>
        </ul>
      </li>
      <li parentName="ul"><inlineCode parentName="li">{`IsClosed`}</inlineCode>{` (`}<em parentName="li">{`bool`}</em>{`)`}</li>
    </ul>
    <p><strong parentName="p">{`tip`}</strong>{`: How to get real-time playback rate?
Without a hardware trigger, the acquisition frame rate might be
unstable. If the playback seems vastly different from real-time, one can
place `}<inlineCode parentName="p">{`TimeInterval`}</inlineCode>{` after `}<inlineCode parentName="p">{`VideoWriter`}</inlineCode>{` to measure the real frame rate
and then specify the corresponding frequency in the `}<inlineCode parentName="p">{`FrameRate`}</inlineCode>{` property
of `}<inlineCode parentName="p">{`VideoWriter`}</inlineCode>{`.`}</p>
    <p>{`With a hardware trigger, one can set the `}<inlineCode parentName="p">{`FrameRate`}</inlineCode>{` property of
`}<inlineCode parentName="p">{`VideoWriter`}</inlineCode>{` equal to the (known) trigger frequency.`}</p>
    <hr></hr>
    <h3 {...{
      "id": "csvwriter-sink"
    }}><strong parentName="h3"><inlineCode parentName="strong">{`CsvWriter`}</inlineCode></strong>{` `}{`#`}{`sink`}</h3>
    <p>{`writes elements of the input sequence to a `}<inlineCode parentName="p">{`.csv`}</inlineCode>{` file`}</p>
    <p><strong parentName="p">{`input`}</strong>{` - accepts several input types (single elements, tuples, arrays) as long as it comes from a single source node`}</p>
    <p><strong parentName="p">{`properties`}</strong>{`:`}</p>
    <ul>
      <li parentName="ul"><inlineCode parentName="li">{`Append`}</inlineCode>{` (`}<em parentName="li">{`bool`}</em>{`) - indicates whether data should be appended to the output file if it already exists`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`Delimiter`}</inlineCode>{` (`}<em parentName="li">{`string`}</em>{`) - separator of columns in the output file; if not specified, comma is used`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`FileName`}</inlineCode>{` (`}<em parentName="li">{`ListSeparator`}</em>{`) - name of the output file or full path to the
output file if the desired path is different from the current
working directory`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`IncludeHeader`}</inlineCode>{` (`}<em parentName="li">{`bool`}</em>{`) - indicates whether to include a text header with column names`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`ListSeparator`}</inlineCode>{` (`}<em parentName="li">{`string`}</em>{`) - separator of elements in variable length rows (optional)`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`Overwrite`}</inlineCode>{` (`}<em parentName="li">{`bool`}</em>{`) - indicates whether the output file should be
overwritten if it already exists`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`Selector`}</inlineCode>{` (`}<em parentName="li">{`string`}</em>{`) - selects a subset of the input's inner properties that will be written to file`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`Suffix`}</inlineCode>{` (`}<em parentName="li">{`Bonsai.IO.PathSuffix`}</em>{`) - optional suffix used to generate
file names: `}<inlineCode parentName="li">{`None`}</inlineCode>{`, `}<inlineCode parentName="li">{`FileCount`}</inlineCode>{`, `}<inlineCode parentName="li">{`Timestamp`}</inlineCode>{`; generates new files
even if `}<inlineCode parentName="li">{`Overwrite`}</inlineCode>{` is set to True
`}</li>
    </ul>
    <p><strong parentName="p">{`output`}</strong>{` - same type as the input`}</p>
    <hr></hr>
    <h3 {...{
      "id": "matrixwriter-sink"
    }}><strong parentName="h3"><inlineCode parentName="strong">{`MatrixWriter`}</inlineCode></strong>{` `}{`#`}{`sink`}</h3>
    <p>{`writes the input signal into a `}<inlineCode parentName="p">{`.bin`}</inlineCode>{` file`}</p>
    <p><strong parentName="p">{`input`}</strong>{` (`}<em parentName="p">{`OpenCV.Net.Mat`}</em>{`) - an array`}</p>
    <p><strong parentName="p">{`properties`}</strong>{`:`}</p>
    <ul>
      <li parentName="ul"><inlineCode parentName="li">{`Layout`}</inlineCode>{`(`}<em parentName="li">{`Bonsai.Dsp.MatrixLayout`}</em>{`) - controls how individual buffer matrices are linearised into disk; when input is a `}<inlineCode parentName="li">{`C x N`}</inlineCode>{` array (where `}<inlineCode parentName="li">{`C`}</inlineCode>{` is number of channels and `}<inlineCode parentName="li">{`N`}</inlineCode>{` is number of samples in buffer), as is the case in almost all bonsai data sources, the appropriate layout is `}<inlineCode parentName="li">{`ColumnMajor`}</inlineCode></li>
      <li parentName="ul"><inlineCode parentName="li">{`Path`}</inlineCode>{` (`}<em parentName="li">{`string`}</em>{`) - name of the output file or full path to the
output file if the desired path is different from the current`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`Suffix`}</inlineCode>{` (`}<em parentName="li">{`Bonsai.IO.PathSuffix`}</em>{`) - optional suffix used to generate
file names: `}<inlineCode parentName="li">{`None`}</inlineCode>{`, `}<inlineCode parentName="li">{`FileCount`}</inlineCode>{`, `}<inlineCode parentName="li">{`Timestamp`}</inlineCode>{`; generates new files
even if `}<inlineCode parentName="li">{`Overwrite`}</inlineCode>{` is set to True `}</li>
      <li parentName="ul"><inlineCode parentName="li">{`Overwrite`}</inlineCode>{` (`}<em parentName="li">{`bool`}</em>{`) - indicates whether the output file should be
overwritten if it already exists`}</li>
    </ul>
    <p><strong parentName="p">{`output`}</strong>{` (`}<em parentName="p">{`OpenCV.Net.Mat`}</em>{`) - the same array`}</p>
    <p><strong parentName="p">{`tip`}</strong>{`: to read a `}<inlineCode parentName="p">{`.bin`}</inlineCode>{` file (written with `}<inlineCode parentName="p">{`ColumnMajor`}</inlineCode>{` layout) in Python, one can use `}<inlineCode parentName="p">{`numpy.fromfile(path, dtype).reshape(-1,C)`}</inlineCode>{` where `}<inlineCode parentName="p">{`C`}</inlineCode>{` is the number of input channels.
`}<inlineCode parentName="p">{`dtype`}</inlineCode>{` depends on the input signal `}<inlineCode parentName="p">{`Depth`}</inlineCode></p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`depth`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`dtype`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`U8`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`np.uint8`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`S8`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`np.int8`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`U16`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`np.uint16`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`S16`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`np.int16`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`S32`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`np.int32`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`F32`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`np.single`}</inlineCode>{` or `}<inlineCode parentName="td">{`np.float32`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`F64`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`np.double`}</inlineCode>{` or `}<inlineCode parentName="td">{`np.float64`}</inlineCode></td>
        </tr>
      </tbody>
    </table>
    <hr></hr>
    <h3 {...{
      "id": "common-errors"
    }}>{`Common errors`}</h3>
    <p><inlineCode parentName="p">{`Runtime Error: Input array must have the same element type`}</inlineCode>{`
Element type may refer to the `}<inlineCode parentName="p">{`Depth`}</inlineCode>{` parameter of input signals (e.g. in `}<inlineCode parentName="p">{`FunctionGenerator`}</inlineCode>{`). It must be the same for all input signals fed into a given writer node.`}</p>
    <p><inlineCode parentName="p">{`Runtime Error: Input array must have the same shape except in the dimension corresponding to axis`}</inlineCode>{`
Happens when input arrays have different shapes, possibly due to unequal `}<inlineCode parentName="p">{`BufferSize`}</inlineCode></p>
    <p><inlineCode parentName="p">{`Runtime Error: A valid file path must be specified`}</inlineCode>{`
Occurs when the `}<inlineCode parentName="p">{`FileName`}</inlineCode>{` or `}<inlineCode parentName="p">{`Path`}</inlineCode>{` property of the writer node is left empty or not specified properly`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
